import React, {useState, useEffect} from "react";
import { useHistory, useParams } from "react-router";
import { NavLink } from "react-router-dom";
import "./Select.css"


const Select = (data) => {
    useEffect(() => console.log(data.data),[]);

    return(
    <div className="selectors">
        <h1>SIEMA</h1>
        
            {data.data.map((standings) => {
                return standings.type === "TOTAL"?
                <select class="minimal" id="1">
                    {standings.table.map((e) => {
                        return(
                            <option key={e.position}>{e.position}. {e.team.name}</option> 
                        );
                    })}
                
                </select>
                :null;
            })}
        
        {data.data.map((standings2) => {
                return standings2.type === "TOTAL"?
                <select class="minimal" id="2">
                    {standings2.table.map((e2) => {
                        return(
                            <option key={e2.position}>{e2.position}. {e2.team.name}</option> 
                        );
                    })}
                
                </select>
                :null;
            })}
    </div>
    );

}
export default Select;
